import React, { useState } from 'react';

const ImageZoom = ({ src, alt }) => {
  const [zoomed, setZoomed] = useState(false);

  const toggleZoom = () => {
    setZoomed(!zoomed);
  };

  return (
    <img
      src={src}
      alt={alt}
      className={zoomed ? 'zoomed' : ''}
      onClick={toggleZoom}
    />
  );
};

export default ImageZoom;
